import React from 'react'
import {Box} from '@mui/material';
const HorizontalScrollbar = ({data}) => {
  return (
    <>
   {data.map((item) => 
   <Box key={item.id || item}
   itemId ={item.id|| item}
   title={item.id || item} >{item}
   m =
   </Box>)}
    </>
  )
}

export default HorizontalScrollbar
